public:

    //  p == Angr == Anagram
    vector<int> findAnagrams(string S, string Angr) {
        
        // DataForBuildAngr[k] --> –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ–µ –ø–æ–ª–æ–∂–∏—Ç–µ–ª—å–Ω–æ–µ –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ —Å–∏–º–≤–æ–ª–æ–≤ 'a' + k –¥–ª—è –ø–æ—Å—Ç—Ä–æ–µ–Ω–∏—è –∞–Ω–∞–≥—Ä–∞–º–º—ã –Ω–∞–ø–æ–¥–æ–±–∏–µ Angr –≤ —Ä–∞–º–∫–∞—Ö windows == [ S[l], S[l + 1], ..., S[r] ]
        // 26 -- –º–æ–∂—â–Ω–æ—Å—Ç—å –∞–ª—Ñ–∞–≤–∏—Ç–∞, –æ–±—É—Å–ª–æ–≤–ª–µ–Ω–Ω–æ–≥–æ —É–ª–æ—Å–≤–∏–µ–º –∑–∞–¥–∞—á–∏: "s and p consist of lowercase English letters."
        array<int, 26> DataForBuildAngr; // —Å–æ–¥–µ—Ä–∂–∏—Ç –ø–æ–ª–æ–∂–∏—Ç–µ–ª—å–Ω–æ–µ –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ —Å–∏–º–≤–æ–ª–æ–≤, –∫–æ—Ç–æ—Ä—ã–µ –Ω–µ–æ–±—Ö–æ–¥–∏–º—ã –¥–ª—è –ø–æ—Å—Ç—Ä–æ–µ–Ω–∏—è –∞–Ω–∞–≥—Ä–∞–º–º—ã –Ω–∞–ø–æ–¥–æ–±–∏–µ Angr
        DataForBuildAngr.fill(0);

        for(char ch : Angr){++DataForBuildAngr[ch - 'a'];}

        int CountCharInWindowForBuildAngr = 0; // –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ —Å–∏–º–≤–æ–ª–æ–≤ –≤ window, –∫–æ—Ç–æ—Ä—ã–µ –ª–µ–∂–∞—Ç –≤ Angr
        
        vector<int> Idxs;
        for(int l = 0, r = 0; r < S.size();++r){

            // ">=" —Ç–∞–∫ –∫–∞–∫ –¥–µ–∫—Ä–µ–º–µ–Ω—Ç–∏—Ä—É–µ–º –Ω–∞ –º–µ—Å—Ç–µ. –ò–º–µ–Ω–Ω–æ –±–ª–∞–≥–æ–¥–∞—Ä—è –¥–µ–∫—Ä–µ–º–µ–Ω—Ç—É –¥–ª–∏ —Å–∏–º–≤–æ–ª–æ–≤, –Ω–µ –ª–µ–∂–∞—â–∏—Ö –≤ Angr, –∏–º–µ–µ—Ç –º–µ—Å—Ç–æ –Ω–µ—Ä–∞–≤–µ–Ω—Å—Ç–≤–æ: DataForBuildAngr[k] < 0
            if(--DataForBuildAngr[S[r] - 'a'] >= 0){ // –µ—Å–ª–∏ —ç—Ç–æ –ø—Ä–∞–≤–¥–∞, —Ç–æ —Å–∏–º–≤–æ–ª DataForBuildAngr[S[r] - 'a'] —Ö–æ—Ç—è-–±—ã —Ä–∞–∑ –≤—Å—Ç—Ä–µ—á–∞–ª—Å—è –≤ Angr
                ++CountCharInWindowForBuildAngr;
            }

            // –µ—Å–ª–∏ CountCharInWindowForBuildAngr == Angr.size() -- –∏—Å—Ç–∏–Ω–∞, —Ç–æ –º–æ–∂–Ω–æ —É—Ç–≤–µ—Ä–∂–¥–∞—Ç—å, —á—Ç–æ
            //  Angr == [ Angr[0], Angr[1], ..., Angr[Angr.size() - 1] ] —è–≤–ª—è–µ—Ç—Å—è –º—É–ª—å—Ç–∏–ø–æ–¥–º–Ω–æ–∂–µ—Å—Ç–≤–æ–º windows == [ S[l], S[l + 1], ..., S[r] ]
            while(CountCharInWindowForBuildAngr == Angr.size()){
                               
                if(r - l + 1 == Angr.size()){Idxs.push_back(l);} // <--> [ Angr[0], Angr[1], ..., Angr[Angr.size() - 1] ] == [ S[l], S[l + 1], ..., S[r] ]

                // —Å–¥–≤–∏–≥–∞–µ–º –ª–µ–≤—ã–π —É–∫–∞–∑–∞—Ç–µ–ª—å. –ï—Å–ª–∏ ++DataForBuildAngr[S[l++] - 'a'] > 0 –∏—Å—Ç–∏–Ω–æ, —Ç–æ –ª–µ–≤—ã–π —É–∫–∞–∑–∞—Ç–µ–ª—å —É–∫–∞–∑—ã–≤–∞–ª –Ω–∞ —Å–∏–º–≤–æ–ª, –ª–µ–∂–∞—â–∏–π –≤ Angr, —Ç.–µ. S[l], 
                // –∏–º–µ–Ω–Ω–æ –ø–æ—ç—Ç–æ–º—É –¥–µ–∫—Ä–µ–º–µ–Ω—Ç–∏—Ä—É–µ–º CountCharInWindowForBuildAngr
                if(++DataForBuildAngr[S[l++] - 'a'] > 0){--CountCharInWindowForBuildAngr;}

            }

        }

        return Idxs;
    }
};

# A simple PowerShell script to backup Out of Ore saves
# Twitter: @Kerbo_
#
$ErrorActionPreference = 'SilentlyContinue'
$oooDir = $env:LOCALAPPDATA + "\OutOfOre\Saved\SaveGames"
$dateString = $(get-date -f yyy-MM-dd_HH-mm)
Push-Location $oooDir

If(!(test-path -PathType container "backups"))
{
      New-Item -ItemType Directory -Path "backups" | Out-Null
}

$saves = Get-ChildItem -Filter *.sav

foreach($save in $saves) {
    $savename = $save.Name
    $basename = $save.BaseName
    
    if($savename -Match ".*-[0-9]{4}-[0-9]{2}-[0-9]{2}") { continue }
    
    $save_hash = Get-FileHash $save
    $backup = gci "backups\$basename-*" | select -last 1
    $backup_hash = Get-FileHash $backup -EV Err -EA SilentlyContinue
    if ( $backup_hash.Hash -eq $save_hash.Hash ) {
        Write-Host "$savename matches latest backup, no backup needed" -ForegroundColor green
    } else {
        cp $savename "backups\$basename-$dateString.sav"
        $RET=$?
        if ($RET) {
            Write-Host "Copied $basename.sav to backups\$basename-$dateString.sav" -ForegroundColor yellow
        } else {
            Write-Host "Error! cp returned $RET for $basename.sav" -ForegroundColor red
        }
    }
}
Pop-Location
# Sleep to show screen output before exiting
Start-Sleep -Seconds 5
